import * as React from 'react';

import { Typography, Divider, Link } from '@material-ui/core';
import { Fade } from 'react-reveal';

const Featured = (props) => {

  return (
    <div className='featured'>
      <Fade big>
        <Divider variant="middle" classes={{ root: props.classes.divider }} />
        <Link href='https://drive.google.com/file/d/1hm2x2hlQXZmHrGEASsJem919KSJugsQG/preview' target='_blank' color='inherit' underline='hover'>
          <Typography variant='h3'>Resume</Typography>
        </Link>
      </Fade>
      <div className='pdf'>
        <Fade big>
          <iframe title='John Zoscak Resume, 2021' src='http://docs.google.com/gview?a=v&pid=explorer&chrome=false&api=true&embedded=true&srcid=1hm2x2hlQXZmHrGEASsJem919KSJugsQG&hl=en&embedded=true' alt='PDF of Resume' frameborder="0" />
        </Fade>
      </div>
    </div>
  );
}
export default Featured;
